import React from 'react'
import { useParams } from 'react-router-dom'
import { useState, useEffect } from 'react'
import axios from 'axios'
import doc3 from '../../resources/doc3.jpg'
import '../../App.css'
import {Formik, Form, Field, ErrorMessage} from 'formik'
import * as Yup from "yup";


import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { CardActionArea } from '@mui/material';

const SpecificDoctor = () => {

  const initialValues={
    name:"",
    age:"",
    email:"",
    mobile:"",
    address:"",
    query:"",
    date: "",
}

const validationSchema = Yup.object().shape({
  name:Yup.string().required(),
  age:Yup.string().required(),
  email:Yup.string().required(),
  mobile:Yup.string().required(),
  address:Yup.string().required(),
  address:Yup.string().required(),address:Yup.string().required(),
});


    let { docId } = useParams();
    const [specificDoctor, setSpecificDoctor] = useState({});
    useEffect(()=>{
        axios.get(`http://localhost:5001/doctors/byId/${docId}`).then((response)=>{
            setSpecificDoctor(response.data)
        })
      },[])

    
  return (
    <div className='specificDocContainer'>
        <div className='specificDocContainerNew'>
        <Card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia component="img" height="140" image={doc3}  alt="green iguana"/>
        <CardContent>
          <Typography gutterBottom variant="h4" component="div">
            {specificDoctor.doctorName}
          </Typography>
          <Typography variant="h5" color="text.secondary">
            {specificDoctor.doctorSpecialization}
          </Typography>
          <Typography variant="h6" color="text.secondary">
            {specificDoctor.doctorExperience} of Service
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
    </div>

    <div className='specificDocForm'>
    <Formik initialValues={initialValues}  validationSchema={validationSchema}>
            <Form className='formContainer'>
              <label>Patient Name: </label>
              <ErrorMessage name="patientName" component="span" />
              <Field id="inputRegisterPatient" name="patientName" placeholder="(Ex. John...)"/>

              <label>Age: </label>
              <ErrorMessage name="patientAge" component="span" />
              <Field autocomplete="off" id="inputRegisterPatient" name="patientAge" placeholder="Age"/>

              <label>Address: </label>
              <ErrorMessage name="patientAddress" component="span" />
              <Field autocomplete="off" id="inputRegisterPatient" name="patientAddress" placeholder="Address"/>

              <label>Email: </label>
              <ErrorMessage name="patientEmail" component="span" />
              <Field autocomplete="off" type="email" id="inputRegisterPatient" name="patientEmail" placeholder="example@gmail.com"/>

              <label>Password: </label>
              <ErrorMessage name="patientPassword" component="span" />
              <Field autocomplete="off" type="password" id="inputRegisterPatient" name="patientPassword" placeholder="Password"/>
              
              <Button variant="contained" type="submit"> Register</Button>
              <br></br>
              <Button color="secondary" variant="contained" type="reset">Reset</Button>
            </Form>
          </Formik>
          </div>


    </div>
  )
}

export default SpecificDoctor
